import React from "react";
import '../style.css';
// import CargoHeader from "./CargoHeader";


function Cargo(){
    return(
        <div className="wrapper">
        <div className="cargo">
            <h5 className="services-caption">Cargo Details</h5>
            <div className="cargo-content">
                <div> <i class="fa fa-toggle-on"></i></div>
                <p id="desc">Dangerous Cargo (ex. Chemicals, Battery)</p>
            </div>

        </div>
        <div className="btn-container">
        <button className="container-btn">
                <button className="inner-btn">Total Dimensions</button> <span>Package Details</span>
        </button>
        </div>

         <fieldset>
            <legend>Total Volume:</legend>
            <p>cbm</p>
            </fieldset>
        </div>
    )
}

export default Cargo;
